def FreqKmerClump(Text, k, t):
	words = []
	counts = dict()
	list1 = []
	for i in range(len(Text)):
		words.append("".join(Text[i: i+k]))

	for word in words:
		counts[word] = counts.get(word, 0) + 1

	for key, v in counts.items():
		if v >= t:
	 		list1.append(key)
	return list1

def clumpFind(Text, k, L, t):

	clump = [];
	list1 = [];

	for i in range(len(Text)-L+1):
		range1 = Text[i:L+i]

		clump.append(FreqKmerClump(range1,k, t))

	for i in clump:
		for j in i:
			if j not in list1:
				list1.append(j)
	print(" ".join(list1))
	return " ".join(list1)

